(3, 'Maxiterm', '0.00', '2021-02-04 19:07:23', 3, , 'Communications terminal program for enabling the CMM2 to exchange data with other computer systems, via built-in COM ports.', 'Xmodem File transfer (with CMM2 firmware 5.06 or higher), selectable font colors (White, Amber, Green) matching famous vintage terminals, autodialer phone book, ASCII monochrome text rendering, retro terminal sound effects, configurable TTL/RS-232 COM port speeds', 'https://github.com/frnno967/maxiterm', 9);
