INSERT INTO `apps` (`id`, `title`, `version`, `changed`, `author`, `screen`, `subtitle`, `description`, `link`, `category`) VALUES
(5, 'Wolfstein 3D', '0.7a', '2021-02-04 20:57:30', 4, , 'Wolfenstein 3D version from scratch for Colour Maximite 2', 'Its possible to read any Wolfenstein stage exported from FLR format\r\nBrown guards, ss, dogs, officers and the first boss are almost full implemented\r\nI think the music is better than the original\r\nThe textures size and resolution are preserved (64x64)\r\nEnemies can open doors and chase you\r\nI think its fun to play if you could ignore some speed constrains\r\nSee the controls list, you can change window size with F5 and made it zoom with F6... And can have something like the resolution of Wolf3D from SNES or Gameboy\r\nI remade some game arts to respect German people, but there are other things that I will do better sometime.', 'https://github.com/mauroxavierneto/wolf3d_cmm2', 3);
INSERT INTO `apps` (`id`, `title`, `version`, `changed`, `author`, `screen`, `subtitle`, `description`, `link`, `category`) VALUES
(6, 'Gauntlet', '0.4a', '2021-02-04 20:59:47', 4, , 'Gauntlet port for the Colour Maximite 2', 'This is a version of Gauntlet to Colour Maximite 2. I dont own any rights about Gauntlet trademark, this is only a homebrew project made by me in my free time, and for sure in the current state, it has lots of bugs. Keep in mind Im only a Gauntlet fan with some basic developing skills and my target is only to challenge myself to port it to CMM2, its not a project with profit intentions.', 'https://github.com/mauroxavierneto/gauntlet_cmm2', 3);

